import React, { useEffect, useState } from "react";
import axios from "axios";
import "./Careersform.css";

const CareersForm = () => {
  const [jobListings, setJobListings] = useState([]);
  const [selectedJob, setSelectedJob] = useState(null);
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone_number: "",
    resume: null,
  });
  const [successMessage, setSuccessMessage] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  useEffect(() => {
    const fetchJobListings = async () => {
      try {
        const response = await axios.get("http://localhost:8000/api/joblistings/");
        setJobListings(response.data);
      } catch (error) {
        console.error("Error fetching job listings:", error);
      }
    };

    fetchJobListings();
  }, []);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData({ ...formData, [name]: name === "resume" ? files[0] : value });
  };

  const handleJobSelect = (job) => {
    setSelectedJob(job);
    setFormData({ ...formData, resume: null }); // Reset resume when selecting a job
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!selectedJob) {
      setErrorMessage("Please select a job to apply for.");
      return;
    }

    const formDataToSend = new FormData();
    formDataToSend.append("name", formData.name);
    formDataToSend.append("email", formData.email);
    formDataToSend.append("phone_number", formData.phone_number);
    formDataToSend.append("resume", formData.resume);
    formDataToSend.append("job", selectedJob.serialno); // Assuming serialno is sent to the backend

    try {
      await axios.post("http://localhost:8000/api/jobapplications/", formDataToSend);
      setSuccessMessage("Application submitted successfully!");
      setErrorMessage("");
      resetForm();
    } catch (error) {
      console.error("Error submitting application:", error);
      setErrorMessage("There was an issue submitting your application. Please try again.");
    }
  };

  const resetForm = () => {
    setFormData({ name: "", email: "", phone_number: "", resume: null });
    setSelectedJob(null);
  };

  return (
    <div className="contactContainer1">
      <h2>Job Listings</h2>
      {jobListings.map((job) => (
        <div key={job.serialno} onClick={() => handleJobSelect(job)} className="jobListing">
          <h3>{job.title}</h3>
          <p>{job.experience_level}</p>
          <p>{job.location}</p>
        </div>
      ))}

      <div className="formSection1">
        <h2>Apply for Selected Job</h2>
        {errorMessage && <div className="error">{errorMessage}</div>}
        {successMessage && <div className="success">{successMessage}</div>}
        <form onSubmit={handleSubmit}>
          <div className="formGroup1">
            <input
              type="text"
              name="name"
              placeholder="Name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>
          <div className="formGroup1">
            <input
              type="email"
              name="email"
              placeholder="Enter Email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div className="formGroup1">
            <input
              type="text"
              name="phone_number"
              placeholder="Phone Number"
              value={formData.phone_number}
              onChange={handleChange}
              required
              maxLength={10}
            />
          </div>
          <div className="formGroup1">
            <input
              type="file"
              name="resume"
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit" className="submitButton1">
            Submit Application
          </button>
        </form>
      </div>
    </div>
  );
};

export default CareersForm;
